import React, { PureComponent } from 'react'
import Navigation from '../Navigation/Navigation'
import Config from './Config'
import ClientSideCheckOut from './ClientSideCheckout'
import PreloadRequest from './PreLoadRequest'
import DisplayBrowser from './DisplayBrowser'
import HandleCallback from './HandleCallback'
import ReceiptRequest from './ReceiptRequest'
import Terminating from './Terminating'
import TestMac from './TestMco'
import MovingProduction from './MovingProduction'
import Checkoutpage from '../RightMenu/CheckOut'
import { ReactComponent as MonerisifLogo } from '../MonerisifLogo.svg'
import { ReactComponent as MeriChatLogo } from '../MeriChatLogo.svg'
import { MailOutlined, AppstoreOutlined, SettingOutlined } from '@ant-design/icons';
import { Menu } from 'antd';
import Helmet from "react-helmet"

import "./FrontPage.css"
export default class FrontPage extends React.Component {
    state = {
        current: 'mail'
    };


    handleClick = e => {
        console.log('click ', e);
        this.setState({ current: e.key });
    };
    render() {
        const { current } = this.state;
        return (
            <div>
                <Navigation />
                <div style={{ width: "50vw", height: "100vh", float: "left", overflowY: "scroll" }}>
                    <div style={{ marginLeft: "20px", float: "left" }}><h3>Building your Moneris Checkout Integration</h3></div>
                    <Config />
                    <ClientSideCheckOut></ClientSideCheckOut>
                    <PreloadRequest />
                    <DisplayBrowser />
                    <HandleCallback />
                    <ReceiptRequest />
                    <Terminating />
                    <TestMac />
                    <MovingProduction />
                </div>
                <div style={{ height: "100vh", width: "49vw", display:"inline-table",float: "left" }}>
                    <button id="tabRed" class="tablink" onclick="openPage('checkout', this, '#6DC7BE')" id="tabDefaultOpen">Checkout Page</button>
                    <button id="tabGreen" class="tablink" onclick="openPage('preload', this, '#6DC7BE')">Preload Response</button>
                    <button id="tabBlue" class="tablink" onclick="openPage('receipt', this, '#6DC7BE')">Receipt Response</button>
                    <div>
                        {/* <Checkoutpage/> */}
                    </div>
                </div>
            </div>
        )
    }
}
